import axios from "axios"
import React from "react"
import {useState} from "react"
import Axios from "axios"

function Search(){
    const [viewTable,setViewTable] = useState([])
    const [date,setDate] = useState()

    const byDate = function(){
        Axios.post("http://localhost:1000/Date",)
        Axios.get("http://localhost:1000/Date").then(() => {
            console.log("Success")
        })
    }
    return(
        <div className="Button">
            <button class="btn btn-primary" onClick={byDate}>Search by Date</button>
            <label>Enter the Date</label>
            <input type="number" onChange={(event) => {setDate(event.target.value)}}/>
            <table>
                  <tr>
                   <th>Booking_ID</th>
                   <th>Name</th>
                   <th>Age</th>
                   <th>Gender</th>
                   <th>Starting From</th>
                   <th>Verification_ID</th>
                  </tr>
            </table>
            {viewTable.map((val,key) => {
           return(
                    <tr>
                    <td>{val.booking_id}</td>
                    <td>{val.name}</td>
                    <td>{val.age}</td>
                    <td>{val.gender}</td>
                    <td>{val.start_place}</td>
                    <td>{val.verification_id}</td>
                  </tr> 
           )
       })}</div>
            

    )
}

export default Search
